import uuidv1 from 'uuid/v1';

import axios from "axios";

const backupState = [
  {
    firstName: 'Martin',
    lastName: 'Scorsese',
    age: 76,
    id: uuidv1()
  },

  {
    firstName: 'Alfred',
    lastName: 'Hitchcock',
    age: 81,
    id: uuidv1(),
  },
  {
    firstName: 'Orson',
    lastName: 'Welles',
    age: 70,
    id: uuidv1(),
  },
];

export const submitFriendState = axios.get('http://localhost:5000/friends/').then(res => {
  if (res.data.length > 0) {
    return [...res.data]
  } else { return backupState }
})
